import React, {memo, useCallback, useEffect} from 'react';
import styled from 'styled-components';
import {NavLink, useNavigate, useParams} from 'react-router-dom';

import Title from '../../components/TitleContainer';

import { useSelector, useDispatch } from 'react-redux';
import { getList } from '../../slices/FouSupContentSlice';

const FDetailPagesContainer = styled.div`
    width:100%;

    .contentContainer{
        max-width:1200px;
        margin: 140px auto 80px;

        .topContent{
            .titleWrap{
                width:100%;
                border-top:3px solid #333333;
                border-bottom: 1px solid #D9D9D9;
                height:80px;
                display: flex;
                justify-content: space-between;
                align-items: center;
                padding:0 20px;

                .title{
                    height: auto;
                    font-size:28px;
                    font-weight: 500;
                }

                .date{
                    width:max-content;
                    white-space: nowrap;
                    text-align: left;
                    color: #959595;
                }
            }

            .bannerImgWrap{
                width:800px;
                margin:50px auto;

                .img{
                    max-width: 800px;
                    text-align: center;
                }
            }
        }
        .summaryWrap{
            margin-top:60px; 

            .title{
                height: auto;
                font-size:24px;
                font-weight: 500;
                margin-bottom:20px;
            }

            .formTable{
                width:100%;

                tbody{
                    border-top:2px solid #333333;

                    tr{
                        height: auto;
                        line-height: 1.3;
                        border-bottom:1px solid #D9D9D9;

                        .row{
                            padding:20px;
                            vertical-align: middle;
                        }

                        td{
                            padding:20px;
